import React, { useContext, useEffect, useState } from "react";
import { UserContext } from "../context/UserProvider";

const JornadasClasification = () => {
  const { getTeam, getWeeklyClasification } = useContext(UserContext);
  const [weeklyClasification, setWeeklyClasification] = useState([]);
  const [weekSelected, setWeekSelected] = useState(1);
  const [position7, setPosition7] = useState([]);
  const [position8, setPosition8] = useState([]);
  const [position9, setPosition9] = useState([]);
  const [position10, setPosition10] = useState([]);

  useEffect(() => {
    // WEEKLY
    fetchWeeks();

    // setWeekSelected(weeklyClasification.length);
  }, []);

  const fetchWeeks = async () => {
    let teamsWeekly = await getWeeklyClasification();
    setWeeklyClasification(teamsWeekly);

    let team7 = await getTeam(teamsWeekly[teamsWeekly.length - 1]?.position7);
    let team8 = await getTeam(teamsWeekly[teamsWeekly.length - 1]?.position8);
    let team9 = await getTeam(teamsWeekly[teamsWeekly.length - 1]?.position9);
    let team10 = await getTeam(teamsWeekly[teamsWeekly.length - 1]?.position10);

    setPosition7(team7);
    setPosition8(team8);
    setPosition9(team9);
    setPosition10(team10);
  };

  const fetchTeams = async (week) => {};

  console.log(position7[0].name);

  return (
    <div className="informationTable">
      <h2>CLASIFICACIÓN GASTOS POR JORNADAS</h2>
      <div className="weeklySelector">
        <select onChange={(selection) => fetchTeams(selection.target.value)}>
          {weeklyClasification.map((week) => {
            return (
              <option
                selected={week.id === weeklyClasification?.length}
                value={week.id}
              >
                Jornada {week.id}
              </option>
            );
          })}
        </select>
      </div>
      <div>
        <div className="tableHeader">
          <div className="teamColumn">Puesto</div>
          <div className="moneyColumn">Equipo</div>
        </div>
        <div>
          {/* POSITION 7 */}
          <div key={7}>
            <div className="tableBody">
              <div className="teamColumn">{position7?.name}</div>
              <div className="moneyColumn">{position7?.moneySpent}€</div>
            </div>
          </div>
          {/* POSITION 8 */}
          <div key={8}>
            <div className="tableBody">
              <div className="teamColumn">{position8?.name}</div>
              <div className="moneyColumn">{position8?.moneySpent}€</div>
            </div>
          </div>
          {/* POSITION 9 */}
          <div key={9}>
            <div className="tableBody">
              <div className="teamColumn">{position9?.name}</div>
              <div className="moneyColumn">{position9?.moneySpent}€</div>
            </div>
          </div>
          {/* POSITION 10 */}
          <div key={10}>
            <div className="tableBody">
              <div className="teamColumn">{position10?.name}</div>
              <div className="moneyColumn">{position10?.moneySpent}€</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default JornadasClasification;
